window.bookSummaryJSON = "<p>She died protecting the man she loved. She died by his hands. And on that blood-soaked grave, vengeance grew.</p> <p>Quinn Darkova leads a listless existence in the dark realm. As honored guest and beloved by Mazzulah, she wants for nothing. But when Risk enters the realm to save her, the dark god can't resist a good bargain.</p> <p>Lazarus is not the man he once was. Consumed by his own grief, he's a beast whose sole motivation in life is getting revenge on the man who took Quinn from him.</p> <p>Fate isn't done with either of them. There's still one game left to play.</p> <p>Winner takes all, and no matter the victor, the Sirian continent will never be the same again.</p> <p>Contains mature themes.</p>"; 
